import React from 'react';
import '../styles/BlogFAQ.css';

function BlogFAQ() {
  return (
    <div className="faq-container">
      <h2>Frequently Asked Questions</h2>
      <div className="faq-item">
        <h4>How do I book a trip?</h4>
        <p>You can click "Book Now" on any trip detail page and fill out the booking form.</p>
      </div>
      <div className="faq-item">
        <h4>Can I cancel my trip?</h4>
        <p>Yes, cancellation policies vary per destination. Please check our Terms & Conditions.</p>
      </div>

      <h3>Contact Us</h3>
      <form className="contact-form">
        <input type="text" placeholder="Your Name" required />
        <input type="email" placeholder="Your Email" required />
        <textarea placeholder="Your Message" required />
        <button type="submit">Send</button>
      </form>
    </div>
  );
}

export default BlogFAQ;
